import './App.css';
import Header from './Components/Header';
import Fotter  from './Components/Footer';
import Hero from './Components/Hero';
import Section3 from './Components/Section3'

function App() {
  return (
    <div className="App">
      <Header />
      <Hero />
      <Section3 />
      <Fotter />
    </div>
  );
}

export default App;
